shed_at:"2022-02-03T22:08:32.345Z",slug:"how-to-fix-the-error-in-data-typeerror-cannot-read-properties-of-null-reading-config-vue2-composition-api-warning-1ljf",path:"/tnorthern/how-to-fix-the-error-in-data-typeerror-cannot-read-properties-of-null-reading-config-vue2-composition-api-warning-1ljf",url:jh,comments_count:0,public_reactions_count:4,page_views_count:57,published_timestamp:"2022-02-03T22:08:32Z",body_markdown:'If you\'ve been using the @vue/composition-api plugin to add composable scripts to develop your Vue2 packages, I\'m sure you\'ve ran into this warning when using your library.\n![Image description](https://dev-to-uploads.s3.amazonaws.com/uploads/articles/nhg3uk7shon9omts5xcf.png)\n \n\n## So.. What\'s the deal?\n\nWell, chances are, your libraries\' `package.json` contains the @vue/composition-api.\n\n```\n "dependencies": {\n    "@vue/composition-api": "^1.4.5"\n  },\n```\n\nIf the consuming application also contains this dependency, you will have run into this error as Vue can\'t decide what the `@vue/composition-api` is since there\'s 2 different versions installed.\n\n## So what\'s the fix?\n\nThere\'s multiple ways to fix this. \n\nIf you are bundling your package with `rollup`, in your `rollup.config.js` or `rollup.config.ts`, add it as an `external` so that rollup doesn\'t bundle it, e.g.:\n\n```\n{\n  input: \'src/yourinputfile.js\',\n  external: [\'vue\', \'@vue/composition-api\'],\n  plugins [...]\n}\n```\n\n**Another option is to add @vue/composition-api as a dev dependency in your library**\n\n```\n"devDependencies": {\n  "@vue/composition-api": "^1.4.5"\n},\n"peerDependencies": {\n  "@vue/composition-api": "^1.4.5" // if you have specific features from newer versions, you can use a peer dependency to tell the consuming app to use this version\n}\n```\n\n**That\'s it!**\n\nFor more such insights, checkout my blog website [https://trayvonnorthern.com](https://trayvonnorthern.com/blog)',positive_reactions_count:4,cover_image:"https://res.cloudinary.com/practicaldev/image/fetch/s--KvnVoFEW--/c_imagga_scale,f_auto,fl_progressive,h_420,q_auto,w_1000/https://dev-to-uploads.s3.amazonaws.com/uploads/articles/gj4x11g9ltpiveo19fho.png",tag_list:["vue","javascript","compositionapi"],canonical_url:jh,reading_time_minutes:1,user:{name:"Tray Northern",username:"tnorthern",twitter_username:a,github_username:"TNortnern",website_url:"https://trayvonnorthern.com",profile_image:"https://res.cloudinary.com/practicaldev/image/fetch/s--sWHcqZEG--/c_fill,f_auto,fl_progressive,h_640,q_auto,w_640/https://dev-to-uploads.s3.amazonaws.com/uploads/user/profile_image/808971/e971d50f-bb63-49de-b338-d062dce6b8a3.jpeg",profile_image_90:"https://res.cloudinary.com/practicaldev/image/fetch/s--XLoFtCvq--/c_fill,f_auto,fl_progressive,h_90,q_auto,w_90/https://dev-to-uploads.s3.amazonaws.com/uploads/user/profile_image/808971/e971d50f-bb63-49de-b338-d062dce6b8a3.jpeg"}}]},root:{appLoading:!1,testimonials:[{_id:Ch,body:"Trayvon is very patient, knowledgeable, understanding and was able to answer all my questions in an articulate and digestible manner. He went above and beyond not only to answer my questions but also to make sure I left the call without any more confusion. He also provided many more resources, tips, and tricks on essential software development concepts.",name:"Gravielr",url:qh,createdAt:"2022-01-19T01:23:04.698Z",updatedAt:"2022-01-19T22:45:51.648Z",__v:0,id:Ch},{_id:Ih,body:"Trayvon is a diamond in the rough on the Upwork marketplace. We have found that for every 5 hires made on Upwork, only about 1 will work out. Trayvon did a test project with us and went above and beyond on it. He's a great communicator and a skilled JavaScript developer. We are now hiring him for an important Vue project.",name:"Bloom CU(Ryan)",url:Gh,createdAt:"2022-01-19T19:36:01.510Z",updatedAt:"2022-01-19T22:04:24.344Z",__v:0,id:Ih},{_id:Lh,name:"Curtis",body:"Trayvon is as excellent a programmer as he is a teacher. I could tell that he has excell
